The '''Nechryarch''' is a [[superior]] variant of [[nechryael]] and [[greater nechryael]]. It has a chance of spawning after purchasing the unlock ''Bigger and Badder'' for 150 [[Slayer reward point]]s from any [[Slayer master]].

Like nechryael, nechryarch can summon minions to assist it in battle. It will summon 3 [[chaotic death spawn]]s, with each one attacking with magic, ranged and melee. These spawns hit harder, but their attacks can be successfully prayed against. Like normal death spawns, they ignore combat restrictions. As players will be subjected to all three forms of combat, a common tactic is to run away from the spawns until they lose interest and repeat until the nechryarch dies. Alternatively, they can be killed with AoE attacks in the [[Catacombs of Kourend]].

Like their standard counterparts, the chaotic death spawns will not be summoned if the nechryarch is unable to attack the player back (such as when being [[safespot]]ted).

Once the Nechryarch dies, the most recent set of chaotic death spawns they summoned will immediately despawn. Any other sets, if any, will despawn in a short period of time.

